SYNOPSIS -

T V Chandran, the director who has given us such gems as 'Ponthan Mada', 'Ormakal Undayirikkanam', 'Dany' and 'Kathabasheshan' is back with a commercial film this time.

Titled 'Shankaranum Mohananum', the film has Jayasurya doing both the title roles. Not only that, he would be seen in more than sixteen get ups in the film.

The film tells the story of two brothers, of whom one is dead. However the brother who is alive, finds his life changed, when the deceased sibling makes appearances before him.

Reema Kallingal and Meera Nandan are the heroines.

The film has been produced under the banners of Prakash Movietone and Ragam Movies. 'Shankaranum Mohananum' would be a June 2011 release.



Cast: Jayasurya, Meera Nandan, Rima Kallingal, Jagathy, Suraj Venjaramood

Director: T V Chandran

Producer: Prem Prakash, Raju Mallyath



